import React from "react";

function CreateProduct({ match }) {
  const productId = match.params.id;

  const handleCreateProduct = async () => {
    // Implement the logic to create a new product
    // You can access the product ID from the `productId` variable
    try {
      const response = await fetch("http://127.0.0.1:5000/product", {
        method: "PUT",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          id: productId,
          title: "New Product Title",
          text: "New Product Description",
          state: "New Product State",
          category: "New Product Category",
        }),
      });

      if (response.ok) {
        // Handle the success case
      } else {
        console.error("Error creating product");
      }
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h2>Create New Product</h2>
      {/* Add form fields to collect the necessary product information */}
      <button onClick={handleCreateProduct}>Create Product</button>
    </div>
  );
}

export default CreateProduct;
